    # --------------------------------------------------------------------------
    def test_invalid_handle(self):
        handle = "thisreallycantbeahandle308"
        result = [(site, self.profile_site[site].is_invalid_handle(handle)) for site in [site for site in list(current.SITES.keys()) if self.profile_site[site].is_website_down() == False]]
        failure_sites = []
        for site, res in result:
            if not res:
                failure_sites.append(site)

        if len(failure_sites) > 0:
            raise RuntimeError(", ".join(failure_sites) + " " + "invalid handle failure")

